,"LearnerInfo.Education.Level":'If the qualification corresponds to a level of the European Qualification Framework (EQF) or to a national classification framework, enter the level. Example: <br><span style="font-weight: bold;">EQF 4</span><br><br><b></b>If necessary, ask the body that awarded the qualification. <br><br>Learn more on the <a href="http://ec.europa.eu/eqf/home_en.htm" target="_blank" class="eqf-help-link">European Qualification Framework (EQF)</a> ',"LearnerInfo.Education.Field":"This item is not displayed on the final document.","SkillsPassport.LearnerInfo.Skills":"<p>When describing your personal skills:</p><ul><li><p>use simple words and clear, unambiguous language;</p></li><li><p>avoid jargon and clichés (e.g. I am a team player) without context-based evidence of skills;</p></li><li><p>be succinct: take time to understand what skills are important for the position you are applying for;</p></li><li><p>Specify in what context they were acquired (through training, work, seminars, voluntary or leisure activities, etc.).</p></li></ul>"
