,B:'I can use advanced features of several communication tools (e.g. using Voice over IP and sharing files). I can use collaboration tools and contribute to e.g. shared documents/files someone else has created. I can use some features of online services (e.g. public services, e-banking, online shopping). I pass on or share knowledge with others online (e.g. through social networking tools or in online communities). I am aware of and use the rules of online communication ("netiquette").',C:"I actively use a wide range of communication tools (e-mail, chat, SMS, instant messaging, blogs, micro-blogs, social networks) for online communication. I can create and manage content with collaboration tools (e.g. electronic calendars, project management systems, online proofing, online spreadsheets). I actively participate in online spaces and use several online services (e.g. public services, e-banking, online shopping). I can use advanced features of communication tools (e.g. video conferencing, data sharing, application sharing)."
